        this.state = {
            arr1 : [12, 13, 14, 15, 16]
        }
    }

    printState = () => {
        return this.state.arr1.map((arr) =>  {
            return arr + 100;
        });

    }

    renderMapFunction = () => {
        return(
            <div>
                <button className='btn btn-secondary' onClick={() => {this.onClickMapFunction}}>Call Map()</button>
            </div>
        )
    }

    onClickMapFunction = () => {
        console.log('logg');
        return <Map array = {this.state.arr1} name = 'Map Function'/>
    }
    render() { 
        return ( 
            <div>
                <h1>Higher Order Functions</h1>
                {this.renderMapFunction()}
            </div>
         );
    }
}

export default Menu;
